und-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eWhich of you is already using Docker?\u003c/p\u003e\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eLocal environments to create faster feedback.\u003c/p\u003e",["https://lh6.googleusercontent.com/cuZqr591BmRmG7MXQNSKsu_vOaXWNcRC2Jnh7FOylmsvWmxlfur43bZ7Tlw5eWIbz-VPXvDIrCTGTGWMWlAoIXMOnal3dw-ES-Ero_nCTso2Z2937RpQI-Zji5_0khQzCt4u"],[],1,{"g293fa6a6e8_0_160":"https://lh6.googleusercontent.com/cuZqr591BmRmG7MXQNSKsu_vOaXWNcRC2Jnh7FOylmsvWmxlfur43bZ7Tlw5eWIbz-VPXvDIrCTGTGWMWlAoIXMOnal3dw-ES-Ero_nCTso2Z2937RpQI-Zji5_0khQzCt4u"}],["g293fa6a6e8_0_5",9,"Docker to the rescue",[],[],[],[],[[],0],[],"\u003cp style\u003d\"font-weight:400;font-style:normal;text-decoration:none;background-color:inherit;color:#000000;font-family:Arial;font-size:11.0pt;font-variant:normal;text-align:left;direction:ltr;\"\u003eDocker is a container technology. Its a virtualization technology like Virtual Machines but some key differences are that Docker is more lightweight. You can easily share applications within teams, and actually people share images all over the world. Its a packaging tool that you can use to package all kinds of different software. And all of these features makes it such a handy tool for testers, because it can help to solve the dependency problem we spoke about in the past slides.\u003c/p\u003e",["https://lh5.googleusercontent.com/1qh9nERjwXViV8B8s_uUe3bAmlCqLG5q5QpmkL20elAn24jD1XhV-DxJ7OCGX4ATTtrcr3wsHcTMVLoD4-XARL_0K0tzER4OkMgP21MhDOhgSB0I93_7ZNzE6sqgROKDfDU6","https://lh6.googleusercontent.com/SeDB6WDHGw_yRbz2XmjpuhySjEblL1fdmu3KKElwXIIV9DJ9RrCGfsbJLt4wSbAu8khZwAOtkooSLwBBpHjibJxvtXjEEILkPHNXSjEf5vIgcTuz6ieu6Ebm0pBgCepDAxgb"],[],1,{"g293fa6a6e8_0_13":"https://lh5.googleusercontent.com/1qh9nERjwXV
